import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <box className="App-nameBox">
          <p>Andrei Frunza</p>
        </box>
        <contact className="App-contact">
          <p className="App-headText">Contact Information</p>
          53 rose branch drive\n 
        </contact>
      </header>
    </div>
  );
}

export default App;
